function App() {
  const tasksState = useSelector(state => state.task)
  console.log(tasksState)
  return (
    <div className="App">
<BrowserRouter>
<Routes>
<Route path="/" element={<TaskList/>}/>
<Route path="/create-task" element={<TaskForm/>}/>
<Route path="/edit-task/:id" element={<TaskForm/>}/>


</Routes>
</BrowserRouter>
          </div>
  );
}

export default App;
